import React from "react";
import { Link as RouterLink } from "react-router-dom";
import { Link } from "@material-ui/core";

const Contacts = ({ contacts }) => {
  return (
    <div>
      <center>
        <h1 style={{ fontSize: 45, color: "grey" }}>CinemaWorld Movies</h1>
      </center>
      {contacts.map((contact) => (
        <div class="card">
          <div class="card-body">
            <div>
              <Link
                color="inherit"
                component={RouterLink}
                variant="h6"
                to="/"
                onClick={() => {
                  console.log("onclick");
                }}
              >
                {contact.Title}
              </Link>
            </div>
          </div>
        </div>
      ))}
    </div>
  );
};

export default Contacts;
